import { Select } from "@material-ui/core"
import { Add, Remove } from "@material-ui/icons"
import styled from "styled-components"
import Announcement from "../components/Announcement"
import Footer from "../components/Footer"
import Navbar from "../components/Navbar"
import Newsletter from "../components/Newsletter"
import { mobile } from "../Responsive"

const Container = styled.div`

`
const Wrapper = styled.div`
        padding:50px;
        display:flex;

        ${mobile({ flexDirection: 'column', padding:'5px 0'})}


`
const ImgContainer = styled.div`
        flex:1;
        
`
const Image = styled.img`
        height:90vh;
        width:100%;
        object-fit:cover;

        ${mobile({ height: '40vh'})}
`
const InfoContainer = styled.div`
        flex:1;
        padding: 0 50px;

        ${mobile({ padding: '0 20px'})}
`
const Title = styled.h2`
        
`
const Desc = styled.p`

        margin:20px 0;
`
const Price = styled.p`
        font-weight:300;
        font-size:40px;

`
const FilterContainer = styled.div`

        width:50%;
        display:flex;
        justify-content:space-between;
        margin:30px 0px;
`
const Filter = styled.div`
        display:flex;
        align-items:center;
`
const FilterTitle = styled.span`
    font-size:20px;
    font-weight:300;
`
const FilterColor = styled.div`
        width:20px;
        height:20px;
        border-radius:50%;
        background-color: ${props => props.color};
        margin:0px 5px;
        cursor:pointer;
`
const FilterSize = styled.select`

        margin-left:10px;
        padding:5px;

`
const FilterSizeOption = styled.option`

`
const AddContainer = styled.div`
        display:flex;
        align-items:center;
        justify-content:space-between;
        width:50%;

`
const AmountContainer = styled.div`
        display:flex;
        align-items:center;
 

        font-weight:700;
`
const Amount = styled.span`

        width:30px;
        height:30px;
        border-radius:10%;
        border:1px solid teal;
        display:flex;
        align-items:center;
        justify-content:center;
        margin:0px 5px;
`
const Button = styled.button`

        padding:15px;
        border:2px solid teal;
        background-color:white;
        cursor:pointer;
        font-weight:300;

        &:hover{
            background-color:teal;
            color:white;
            
        }
`

const Product = () => {
    return (
        <div>
            <Container>
                <Navbar />
                <Announcement />
                <Wrapper>
                    <ImgContainer>
                        <Image src='https://i.ibb.co/S6qMxwr/jean.jpg' />
                    </ImgContainer>
                    <InfoContainer>
                        <Title>Denim Blue Jeans</Title>
                        <Desc>A very nice Jeans with blue color all over it
                            alongwith white patches that increases the style
                            of this jeans more.lorem ipsum hello done go for
                            it you know what time it is.White patches that increases the style
                            of this jeans more.lorem ipsum hello done go for
                            it you know what time it is.</Desc>
                        <Price>$20</Price>
                        <FilterContainer>
                            <Filter>
                                <FilterTitle>Color</FilterTitle>
                                <FilterColor color='black' />
                                <FilterColor color='darkblue' />
                                <FilterColor color='gray' />
                            </Filter>
                            <Filter>
                                <FilterTitle>Size</FilterTitle>
                                <FilterSize>
                                    <FilterSizeOption>XS</FilterSizeOption>
                                    <FilterSizeOption>S</FilterSizeOption>
                                    <FilterSizeOption>M</FilterSizeOption>
                                    <FilterSizeOption>L</FilterSizeOption>
                                    <FilterSizeOption>XL</FilterSizeOption>
                                </FilterSize>
                            </Filter>
                        </FilterContainer>
                        <AddContainer>
                            <AmountContainer>
                                <Remove />
                                <Amount>1</Amount>
                                <Add/>
                            </AmountContainer>
                            <Button>ADD TO CART</Button>
                        </AddContainer>
                    </InfoContainer>
                </Wrapper>
                <Newsletter />
                <Footer/>
            </Container>
            
        </div>
    )
}

export default Product
